class App extends Component {

  constructor(){
    super()
    this.state = {
      murals: []
    }
  }

  componentDidMount(){
    fetch()
  }


  render(){
    return(
      <Router>
        <div>
          <Navbar/>
          <Route exact path='/' component={Home}/>
          <Route exact path='/murals' component={Murals}/>
          <Route exact path='/about' component={About}/>
        </div>
      </Router>
    )
  }
}

export default App;
